import React from 'react'

const AnimalFilter = ({filterState}) => {
  const [filterVal, setFilterVal] = filterState;

  return (
    <input
        type="text"
        value={filterVal}
        onChange={(e) => setFilterVal(e.target.value)}
    />
  )
}

export default AnimalFilter
